import React from 'react';
import PopupWithForm from './PopupWithForm';

function ConfirmDelPopup() {
    return (
        <PopupWithForm
        isOpen={isOpen}
        onClose={onClose}
        onSubmit={onSubmit}
        name="delete-card-popup"
        headerText="Delete card"
        buttonText="Delete"
        >
        </PopupWithForm>
    );
}

export default ConfirmDelPopup;
